import React from "react";
import Grid from "@material-ui/core/Grid";
import Program from "./Program";

class ProgramGrid extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <Grid container spacing={3}>
          <Program/>
        </Grid>
      </div>
    );
  }
}

export default ProgramGrid;
